import React from 'react'

const MyButton = ({isLoading, onClick, title}) => {
  return (
    <button className='btn w-full rounded-md bg-cyan-500 p-2 text-white' onClick={()=> onClick}>
        {isLoading ? "" : title}
    </button>
  )
}

export default MyButton
